import React from "react";

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

class Home extends React.Component<null, MyState> {
  state: MyState = {
    count: 0
  }

  render() {
    return (
      <h1>{this.state.count}</h1>
    );
  }
}

export default Home;
